import './Swiper.css';
import React, { Component } from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";

export default class Responsive extends Component {
  render() {
    var settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 4,
      slidesToScroll: 1,
      speed: 2000,
      autoplay: true,
      autoplaySpeed: 2000,
      cssEase: "linear",
      initialSlide: 0,
      responsive: [
        {
          breakpoint: 1024,
          settings: {
            slidesToShow: 3,
            slidesToScroll: 3,
            infinite: true,
            dots: true
          }
        },
        {
          breakpoint: 600,
          settings: {
            slidesToShow: 2,
            slidesToScroll: 2,
            initialSlide: 2
          }
        },
        {
          breakpoint: 480,
          settings: {
            slidesToShow: 1,
            slidesToScroll: 1
          }
        }
      ]
    };
    return (
      <div style={{position: 'relative', width: '1000px'}}>
      <div className="s">
        <h2> Responsive </h2>
        <Slider {...settings}>
          <div className="div__item">
            <h3>1</h3>
            <img src="https://picsum.photos/200?random-1"/>
          </div>
          <div className="div__item">
            <h3>2</h3>
            <img src="https://picsum.photos/200?random-2"/>
          </div>
          <div className="div__item">
            <h3>3</h3>
            <img src="https://picsum.photos/200?random-3"/>
          </div>
          <div className="div__item">
            <h3>4</h3>
            <img src="https://picsum.photos/200?random-4"/>
          </div>
          <div className="div__item">
            <h3>5</h3>
            <img src="https://picsum.photos/200?random-5"/>
          </div>
          <div className="div__item">
            <h3>6</h3>
            <img src="https://picsum.photos/200?random-6"/>
          </div>
          <div className="div__item">
            <h3>7</h3>
            <img src="https://picsum.photos/200?random-7"/>
          </div>
          <div className="div__item">
            <h3>8</h3>
            <img src="https://picsum.photos/200?random-8"/>
          </div>
        </Slider>
      </div>
      </div>
    );
  }
}
